actions.schemaDefinition:
const dataUrl = baseApiUrl + '/app-configuration/checkbox-values?componentType=ProgramAssessment&settings=phoneTypes';
component.data.url = dataUrl;
schema = component;

templates.tableRow:
{% util.eachComponent(components, function(component) { %}
    {% if (!component.hasOwnProperty('tableView') || component.tableView) { %}
      <td class="editgrid-table-column">
        {{ getView(component, row[component.key]) }}
      </td>
    {% } %}
  {% }) %}
  {% if (!instance.options.readOnly && !instance.disabled) { %}
    <td class="editgrid-table-column">
      <div class="btn-group">
        <button class="btn btn-default btn-light btn-sm editRow" aria-label="{{ t('Edit row') }}"><i class="{{ iconClass('edit') }}"></i></button>
        {% if (!instance.hasRemoveButtons || instance.hasRemoveButtons()) { %}
        <button class="btn btn-danger btn-sm removeRow" aria-label="{{ t('Remove row') }}"><i class="{{ iconClass('trash') }}"></i></button>
        {% } %}
      </div>
    </td>
  {% } %}

components.calculateValue:
if(data.dateOfBirth && data.dateOfBirth != ''){
  value = data.dateOfBirth.replace(/-/g, '\/').replace(/T.+/, '');
} else {
  value = '';
}

if(data.dateOfBirth){
var date = data.dateOfBirth;
var diff = moment().diff(date, 'years');
value = diff;
//var duration = moment.duration(diff);
//value = duration._data.years;
}

components.customConditional:
if(typeof data.age != 'undefined' &&  data.gender !== '') {
  show = (((data.gender == 1 || data.gender == -1) && ( data.age < 18 || data.age > 65) ) || data.gender == 0 );
} else show = false;

if(typeof data.age != 'undefined' && data.gender !== '') {
  show = (data.gender === 1 || data.gender === -1) && (data.age > 17 && data.age < 66);
} else show = false;

actions.customAction:
let dob = new Date(data.dateOfBirth);
const mxDate = dob.setFullYear(dob.getFullYear() + 25);
dob = new Date(data.dateOfBirth);
dob.setMonth(dob.getMonth()-1);
const mnDate = dob.setFullYear(dob.getFullYear() + 18);
component.datePicker.maxDate = moment(mxDate);
component.datePicker.minDate = moment(mnDate);
component.widget.maxDate = moment(mxDate);
component.widget.minDate = moment(mnDate);

components.customDefaultValue:
const dataUrl = baseApiUrl + '/app-configuration/checkbox-values?componentType=application&settings=tbl_ucclaim_lu&lang=E';
component.data.url = dataUrl;
schema = component;

validate.custom:
const div = document.getElementsByClassName('formio-component-eduInfo.suggestedOccupation')[0];
if(div) {
  const item = div.querySelector('div.dropdown select.choices__input option');
  if(item) {
    const rt = item.innerHTML.replace("&lt;span&gt;", "");
    data.eduInfo.occupationTitle = rt.replace("&lt;/span&gt;", "");
  } else {
    data.eduInfo.occupationTitle = '';
  }
}
